const Header = () => {
  return (
    <header className="bg-gray-900 text-white shadow-md">
      <nav className="container mx-auto p-4 flex justify-between items-center">
        <div className="text-xl font-bold">Book Exchange Platform</div>
        <ul className="flex space-x-6">
          <li><a href="#" className="hover:text-gray-300">Home</a></li>
          <li><a href="#" className="hover:text-gray-300">Browse Books</a></li>
          <li><a href="#" className="hover:text-gray-300">List a Book</a></li>
          <li><a href="#" className="hover:text-gray-300">Profile</a></li>
          <li><a href="#" className="hover:text-gray-300">Login/Register</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
